import React from 'react';
import logo from './logo.svg';
import './App.css';

let text = "The betterment of the world can be accomplished..."
let Author = "Baha'u'llah"
function quoteBox(props){
  return (
    <div id="quote-box">
      {quoteText()}
      {authorName()}
      <NewQuote />
    </div>
  )
}

function quoteText(){
  return (
    <div id='text' >"{text}"</div>
  )
}

function authorName(){
  return (
    <div >-{Author}</div>
  )
}
class NewQuote extends React.Component {
  constructor(props){
    super(props);
  }
  render() {
    return (

      <div id="new-quote">This button gives a new quote</div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >

          Learn React
        </a>
        {quoteBox()}
      </header>

    </div>
  );
}

export default App;
